        super(props);
        this.state = {};
    }

    render() {
        return (
            <div>
                <h1>ðŸ§© Coding ðŸ§©</h1>
                <hr/><br/>
                <u><h2>Polysymph Synthesizer</h2></u>

                <div>
                    In the fall semester of 2020, I took a class called "How Music Works: Engineering the Acoustical World", in which we applied concepts from mechnical and eletrical engineering to explore and create our own musical systems.
                    For my final project, I developed a web app called <a href="https://polysymph.herokuapp.com" target="_blank" style={{color: "green"}}>PolySymph</a> (a wordplay of Polyphonic Synthesizer + Symphony),
                    a music composition app that allows you to experiment with the fundamental components of a band in a uniquely displayed format.
                </div>

                <br/>

                <div>
                    In this hackathon, I helped design a project called
                    <a href="https://polysymph.herokuapp.com"> VotrCrwd</a>, an all in one voting information system that provides polling station locations and capacities using real-time user location data in order to help voters track whether their polling location is unusually crowded and decide how safe it is to vote.
                    VotrCrwd also provides users with voter registration and absentee ballot request information.

                </div>
